import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: 674px;
  background: #f4f4f4;
  display: flex;
  justify-content: center;
  padding: 29px 22px 57px 22px;
  flex-direction: column;
  h2 {
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    text-align: center;
    color: #000000;
  }
  p {
    font-size: 20px;
    line-height: 30px;
    color: #000000;
    text-align: center;
  }
`;

export const List = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-around;
  .product {
    width: 395px;
    height: 446px;
    justify-content: flex-start;
    align-items: flex-start;
    padding: 12px 27px 19px 27px;
    h3 {
      margin-bottom: 20px;
    }
    svg {
      width: 40px;
      height: 40px;
      background: #f4f4f4;
      border-radius: 32px;
      padding: 10px;
    }
  }
`;
